import React from 'react'
import { withOidcUser } from 'react-oidc'

function App(props) {
  const { oidcUser } = props

  return (
    <div>
      {oidcUser ? (
        <div>
          <p>Welcome, {oidcUser.profile.name}!</p>
          <button onClick={() => props.userManager.signoutRedirect()}>
            Sign Out
          </button>
        </div>
      ) : (
        <button onClick={() => props.userManager.signinRedirect()}>
          Sign In
        </button>
      )}
    </div>
  )
}

export default withOidcUser(App)
